fields.description:
Shanyraq – это главное ежегодное, масштабное событие для всех, кто хочет воплотить в реалии свои мечты, выйти на новый уровень и раскрыть свой скрытый потенциал.

Информация о билетах:

VIP:
— брендированный блокнот, ручка, стикерпак, худи;
— доп. учебные материалы;
— обед и фотосессия со спикерами;
— книга;
— доступ к закрытому чату пакета VIP;
— запись форума и презентации спикеров;
— фотограф и видеограф.

PREMIUM:
— брендированный блокнот, ручка, стикерпак;
— доступ к закрытому чату пакета Premium;
— запись форума и презентации спикеров.
